import React, { useState } from "react";
import "./Cotacao.css";

const Cotacao = () => {
  const [formData, setFormData] = useState({
    cepOrigem: "",
    cepDestino: "",
    altura: "",
    largura: "",
    comprimento: "",
    peso: "",
    valorNotaFiscal: "0",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Cotação enviada:", formData);
    // Aqui será feita a requisição para calcular o frete
  };

  return (
    <div className="cotacao-container">
      <h2 className="title">Cotação de Frete</h2>
      <form onSubmit={handleSubmit} className="cotacao-form">
        <div className="form-group">
          <label>CEP de Origem:</label>
          <input type="text" name="cepOrigem" value={formData.cepOrigem} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>CEP de Destino:</label>
          <input type="text" name="cepDestino" value={formData.cepDestino} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Altura (cm):</label>
          <input type="number" name="altura" value={formData.altura} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Largura (cm):</label>
          <input type="number" name="largura" value={formData.largura} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Comprimento (cm):</label>
          <input type="number" name="comprimento" value={formData.comprimento} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Peso (kg):</label>
          <input type="number" name="peso" value={formData.peso} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Valor da Nota Fiscal (R$):</label>
          <input type="number" name="valorNotaFiscal" value={formData.valorNotaFiscal} onChange={handleChange} />
        </div>
        <button type="submit" className="btn-calcular">Calcular</button>
      </form>
    </div>
  );
};

export default Cotacao;
